import React, {Component} from 'react';
import styled from  'styled-components';

class Login extends Component {
    render() {
        return(
            <div>
                <LoginForm>
                    <input type='text' className='id' placeholder='아이디'></input>
                    <input type='text' className='password' placeholder='비밀번호'></input>
                </LoginForm>
            </div>
        )
    }
}

export default Login;

const LoginForm = styled.div`
    margin-top: 200px;
`
